import fetch from 'isomorphic-fetch';
var apiDomain = "https://api-bedrijfswebsite.mediaverse-dev.nl";
export function postContact(body) {
  return fetch("".concat(apiDomain, "/test/api/auth/contact"), {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      "Content-Type": "application/json"
    },
    cache: 'default',
    mode: 'cors',
    body: JSON.stringify(body)
  }).then(function (resp) {
    return resp.json();
  });
}
